import styled from "styled-components";

const Container = styled.div.attrs({ className: "flex items-center" })`
  @media (min-width: 1020px) {
    max-width: 1684px;
    padding-left: 122px;
    padding-right: 122px;
  }

  @media (min-width: 620px) {
    max-width: 1600px;
    padding-left: 80px;
    padding-right: 80px;
  }
`;
export default LargeHeader = () => (
  <Container>
    <a href="/en-ca/" className="flex-grow-10">
      <img
        src="/images/header-logo.svg"
        alt="Wealthsimple"
        className="header-logo-image"
      />
      <img
        src="/images/header-logo-small.svg"
        alt="Wealthsimple"
        className="header-logo-image-small"
      />
    </a>
  </Container>
);
